import React from "react";
import { Button, Container, Image } from "react-bootstrap";
import browser from "../../images/application-icon.png";

const About = () => {
  return (
    <Container>
      <h1>A little bit about me...</h1>
      <Image src={browser} />
      <div style="width:100%;height:0;padding-bottom:89%;position:relative;">
        <iframe
          src="https://giphy.com/embed/xT9IgzoKnwFNmISR8I"
          width="100%"
          height="100%"
          style="position:absolute"
          frameBorder="0"
          class="giphy-embed"
          allowFullScreen
        ></iframe>
      </div>
      <p>
        <a href="https://giphy.com/gifs/code-coding-seamless-xT9IgzoKnwFNmISR8I">
          via GIPHY
        </a>
      </p>
      <Button variant="primary">Primary</Button>
      <Button variant="outline-primary">Primary</Button>{" "}
    </Container>
  );
};

export default About;
